import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row'
import Container from 'react-bootstrap/Container';
import Tabs from 'react-bootstrap/Tabs';
import Tab from 'react-bootstrap/Tab';
import Button from 'react-bootstrap/Button';
import { Fade } from "react-awesome-reveal";
import '.././page_css/solution.css';
import back from '../../components/static/back.png';
import arc1 from '../../components/static/tc-arc1.PNG';
import arc2 from '../../components/static/tc-arc2.PNG';
import arc3 from '../../components/static/tc-arc3.PNG';
import exe from '../../components/main.exe';
import play from '../../components/gif/play-btn.png';
import pause from '../../components/gif/pause-btn.png';

import mp4 from '../../components/gif/tax-ocr.mp4';


class TaxOCR extends Component {
    constructor(props){
        super(props);
        this.state = {
            play: true
        }
    }

    getVideo = e => {
        this.video = e
    }

    playVideo = () => {
        this.video.play();
        this.setState({
            play: !this.state.play
        });
    }
    pauseVideo = () => {
        this.video.pause();
        this.setState({
            play: !this.state.play
        });
    }
    render() {
        return (
            <div className='solution'>
                <Container>
                    <Fade>
                        <Row id='description'>
                            <Col>
                                <p id='description-title'><strong>Tax OCR</strong><Link to='/ocr'><img src={back} alt='img' id='back-icon' /></Link></p>
                            </Col>
                        </Row>
                        <Row>
                            <Col>
                                <Tabs style={{ borderBottom: '' }} defaultActiveKey="description" transition={false}>
                                    <Tab id='tab-btn' eventKey="description" title="Description">
                                        <div className='desc'>
                                            <h1>emphasis-content</h1>
                                            <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>
                                            <h1>emphasis-content</h1>
                                            <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>

                                        </div>
                                    </Tab>
                                    <Tab id='tab-btn' eventKey="architecture" title="Architecture">
                                        <div className='arch'>
                                            <p id='sc-title'>Project Scope</p>
                                            <img src={arc1} alt="gif" style={{ width: '100%' }} />
                                            <p id='sc-title'>Hardware Architecture</p>
                                            <img src={arc2} alt="gif" style={{ width: '100%' }} />
                                            <p id='sc-title'>Software Architecture</p>
                                            <img src={arc3} alt="gif" style={{ width: '100%' }} />
                                        </div>
                                    </Tab>
                                    <Tab id='tab-btn' eventKey="gif" title="Video">
                                        {/* <img src={gif} alt="gif" id='gif' /> */}
                                        <video style={{width: '100%'}} ref={this.getVideo} src={mp4} type="video/mp4"/>
                                        <img className='play' src={this.state.play? play : pause} alt="play" onClick={this.state.play? this.playVideo : this.pauseVideo} />
                                    </Tab>
                                    <Tab id='tab-btn' eventKey="live_demo" title="Live Demo" style={{ textAlign: 'center' }}>
                                        <div style={{ marginTop: '0%' }}>
                                            <a id='tc-btn' href={exe} download><Button id='tc-btn' block variant="outline-light" size="lg">Download</Button></a>
                                        </div>
                                    </Tab>
                                </Tabs>
                            </Col>
                        </Row>
                    </Fade>
                </Container>
            </div>
        );
    }
}

export default TaxOCR;
